import React from 'react';
import { Link } from 'react-router-dom';

function NotFound() {
  return (
    <div style={{ textAlign: 'center', padding: '50px 20px' }}>
      <h1>404 - Page Not Found</h1>
      <p>The page you are looking for does not exist.</p>
      <Link to="/">
        <button style={{ 
          background: '#1a73e8', 
          color: 'white', 
          border: 'none', 
          padding: '10px 15px', 
          borderRadius: '4px',
          cursor: 'pointer',
          marginTop: '20px' 
        }}>
          Return to Home
        </button>
      </Link>
    </div>
  );
}

export default NotFound;
